class Solution(object):
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        l = []
        visit = set()
        row = len(grid)
        col = len(grid[0])
        count = 0
        for idx_x, num_x in enumerate(grid):
            for idx_y, num_y in enumerate(num_x):
                if num_y == "1" and (idx_x,idx_y) not in visit:
                        l.append([idx_x,idx_y])
                        visit.add((idx_x,idx_y))
                        count = count + 1
                while len(l):
                    a = l.pop(0)
                    if a[0] + 1 < row and grid[a[0]+1][a[1]] == "1" and (a[0] + 1, a[1]) not in visit:
                         l.append([a[0] + 1, a[1]])
                         visit.add((a[0] + 1, a[1]))
                    if a[1] + 1 < col and grid[a[0]][a[1]+1] == "1" and (a[0], a[1] + 1) not in visit:
                         l.append([a[0], a[1] + 1])
                         visit.add((a[0], a[1] + 1))
                    if a[0] - 1 >= 0 and grid[a[0]-1][a[1]] == "1" and (a[0] - 1, a[1]) not in visit:
                         l.append([a[0] - 1, a[1]])
                         visit.add((a[0] - 1, a[1]))
                    if a[1] - 1 >= 0 and grid[a[0]][a[1]-1] == "1" and (a[0], a[1] - 1) not in visit:
                         l.append([a[0], a[1] - 1])
                         visit.add((a[0], a[1] - 1))
                    
        return count

